import React from 'react';

const Loader = (props) => {
  return (
    <div class="ui active dimmer">
        <div class="ui big text loader"><h2>{props.message}</h2></div>
    </div>
    );
};

Loader.defaultProps = {
    message : "Loading..."
}

export default Loader;
